

    /**
     * Safer Object.hasOwnProperty
     */
     /**
      * Description
      * @method hasOwn
      * @param {} obj
      * @param {} prop
      * @return CallExpression
      */
     function hasOwn(obj, prop){
         return Object.prototype.hasOwnProperty.call(obj, prop);
     }

     module.exports = hasOwn;


